import React, {Component} from 'react';
import {Form, Input, Tabs, TreeSelect} from "antd";
import addMemberStyle from './index.module.css';

const {TabPane}=Tabs;

class AddMembers extends Component {
    render() {
        return (
            <div className={addMemberStyle.container}>
                <Tabs>
                    <TabPane tab='单个添加' key=''>
                        <Form>
                            <Form.Item label='登录账号'>
                                <Input/>
                            </Form.Item>
                            <Form.Item label='归属组织'>
                                <TreeSelect/>
                            </Form.Item>
                            <Form.Item label='角色'>
                                <Input/>
                            </Form.Item>
                        </Form>
                    </TabPane>
                </Tabs>
            </div>
        );
    }
}

export default AddMembers;
